        }
        // tmp是引用类型变量
        dst.push([].concat(tmp));
        tmp.length = 0;
        i = j - 1;
        break;
      }
    }
  }
  // console.log(dst);
  dst.every(item => {
    // if (min === 1) {
    //     result = false;
    //     return false;
    // }
    console.log(item.length);
    console.log(min);
    if (item.length % min !== 0 || min < 2) {
      result = false;
      return false;
    }
  });
  return result;
    }
